import React, { Component } from 'react';

const GameMap = (props) => {
  const renderMap = [];
  props.map.forEach(row => {
    row.forEach(cell => {renderMap.push(
      `<div classname="gameCell"> Winnie: ${cell.winnie}, Wonton: ${cell.wonton}</div>`)
    })
  })

  return (
    <div className="gameBoard">
      ${renderMap}
    </div>
  )
}

export default GameMap;
